def extract_match_time(text):
    pattern = r"\d{2}:\d{2}:\d{2},\d{3} --> \d{2}:\d{2}:\d{2},\d{3}"
    match = re.search(pattern, text)
    if match:
        return match.group()
    else:
        return None

