def verify_fortran_variable_name(variable_name):
    if len(variable_name) > 31:
        return False
    if not variable_name.isalnum():
        return False
    if not variable_name[0].isalpha():
        return False
    if not all(char.isalnum() or char == '_' for char in variable_name):
        return False
    return True

